import { useState } from 'react'
import Layout from '../components/layout'
import OneContainer from '../components/oneContainer'
import TwoContainer from '../components/twoContainer'
import ThreeContainer from '../components/threeContainer'
import FourContainer from '../components/fourContainer'
import FiveContainer from '../components/fiveContainer'
import SixContainer from '../components/sixContainer'
import React from 'react'
import { motion, AnimatePresence } from "framer-motion"



const Index = () => {  
  const [objectDisplay, setObjectDisplay] = useState(1)

  const NextObject = () =>{
    if(objectDisplay<=5){
    setObjectDisplay(objectDisplay+1)
    } else {
      setObjectDisplay(objectDisplay-1)
    }
  }




  return (
   <Layout>
     <AnimatePresence>
      <OneContainer clickOne={NextObject}/>
      <Two clickOne={NextObject}/>
      <Three clickOne={NextObject}/>
      <Four clickOne={NextObject}/>
      <Five clickOne={NextObject}/>
      <Six clickOne={NextObject}/>
     </AnimatePresence>
    </Layout>
  )
}

export default Index


